import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Autocomplete, { Option } from './components/Autocomplete';  // Explicitly specify .tsx extension


const App: React.FC = () =>{
  const options = [
    {value: 'apple', label: 'Apple'},
    {value: 'banana', label: "Banana"},
    {value: 'cherry', label: "Cherry"},
  ];
  const handleInputChange = (inputValue: string) => {
    console.log('Input changed:', inputValue);
  };
  const handleChange = (selected: any) => {
    console.log('Selected:', selected);
  };

  const defaultFilterOptions = (options: Option[], inputValue: string) => {
    return options.filter(option =>
      option.label.toLowerCase().includes(inputValue.toLowerCase())
    );
  };

  // Example render option function
  const renderOption = (option: Option) => {
    return <div>{option.label}</div>;
  };

  const [value, setValue] = useState<Option | Option[]>([]); // Example state for value

  return(
    <div className="App">
      <header className = "App-header">
        <h1>Autocomplete Component Example</h1>
      </header>
      <main className = "App-main">
        <Autocomplete
        options = {options}
        onInputChange={handleInputChange}
        onChange={handleChange}
        placeholder = "Search..."
        description="Type to search..."
        disabled = {false}
        filterOptions={defaultFilterOptions}
        label="Search options"
        loading = {false}
        multiple={false}
        renderOption={renderOption}
        value = {value}
        />
      </main>
    </div>
  );
};
export default App;
